import React from 'react'

const Projects = () => {
  return (
    <div>
       <h2>Projects</h2>
       <AddProject/>

       {generateTokenAndSetCookie.length === 0? <div><h2>No Record</h2></div>  :  generateTokenAndSetCookie.map(todo => ( <div> {todo} </div>))}
    </div>
  )
}

export default Projects
